import './App.css';
import Pilogo from './imagenes/Pi-logo.png';

function App() {
  return (
    <div className='App'>
      <div className='proyecto-logo-contenedor'>
        <img
        src={Pilogo}
        className='proyecto-logo'
        alt='Logo de proyecto'/>
      </div>
      <div className='contenedor'>

      </div>
    </div>
  );
}

export default App;
